import React from "react";
import beach from "/Users/danielaramos/Documents/GitHub/personal/react-website/src/pics/me_beach.jpg";
const Home = () => {
    return (
        <div className="home">
            <img className = {"pics"} src={beach} alt="Me image" height={400} width={300}/>
            <div className="home-text">

                <h1 className="home-title">Dani Ramos Ojeda</h1>
                <h3 className="blurb">I'm a software developer and student at Cornell University interested in NLP, 
                Computational Lingustics, and how technology can be developed by 
                and for the communities whose data is used to develop it.</h3>

                <h3 className="blurb">A big part of my interest in these topics 
                revolves around Language Reclamation, particularly across the Americas! </h3>

                <h3 className="blurb">At Cornell, I have worked as a facillitator for Academic Excellence 
                Workshops, support courses students can take for credit to reinforce their learning. 
                I had the opportunity to be a facillitator for CS 3110:Data Structures and Functional Programming. 
                Although my focus remains in the realm of NLP, Ocaml is one of my favorite languages.</h3>

            </div>



        </div>
    );
};

export default Home;
